import React, { useState, useEffect } from 'react';
import { adminApiService, DashboardStats, Activity } from '../../services/adminApi';
import './Dashboard.css';

const Dashboard: React.FC = () => {
  const [stats, setStats] = useState<DashboardStats | null>(null);
  const [activities, setActivities] = useState<Activity[]>([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);

  useEffect(() => {
    loadDashboardData();
  }, []);

  const loadDashboardData = async () => {
    try {
      setLoading(true);
      setError(null);

      const [statsData, activitiesData] = await Promise.all([
        adminApiService.getDashboardStats(),
        adminApiService.getRecentActivity(10)
      ]);

      setStats(statsData);
      setActivities(activitiesData);
    } catch (err) {
      setError(err instanceof Error ? err.message : 'Error cargando datos');
      console.error('Error loading dashboard:', err);
    } finally {
      setLoading(false);
    }
  };

  const formatCurrency = (amount: number) => {
    return new Intl.NumberFormat('es-ES', {
      style: 'currency',
      currency: 'EUR'
    }).format(amount);
  };

  const formatDate = (dateString: string) => {
    const date = new Date(dateString);
    return new Intl.DateTimeFormat('es-ES', {
      day: '2-digit',
      month: 'short',
      year: 'numeric',
      hour: '2-digit',
      minute: '2-digit'
    }).format(date);
  };

  const getActivityIcon = (type: string) => {
    switch (type.toLowerCase()) {
      case 'pago':
        return 'üí≥';
      case 'carpeta':
        return 'üìÅ';
      case 'foto':
        return 'üì∑';
      default:
        return 'üìå';
    }
  };

  const getStatusClass = (status: string) => {
    switch (status.toLowerCase()) {
      case 'completado':
        return 'status-completed';
      case 'pendiente':
        return 'status-pending';
      case 'error':
        return 'status-error';
      default:
        return '';
    }
  };

  if (loading) {
    return (
      <div className="dashboard-loading">
        <div className="spinner"></div>
        <p>Cargando dashboard...</p>
      </div>
    );
  }

  if (error) {
    return (
      <div className="dashboard-error">
        <h3>Error al cargar el dashboard</h3>
        <p>{error}</p>
        <button onClick={loadDashboardData} className="btn-retry">
          Reintentar
        </button>
      </div>
    );
  }

  return (
    <div className="dashboard">
      <div className="dashboard-header">
        <h1>Dashboard</h1>
        <button onClick={loadDashboardData} className="btn-refresh">
          üîÑ Actualizar
        </button>
      </div>

      {/* Stats Cards */}
      <div className="stats-grid">
        <div className="stat-card">
          <div className="stat-icon">üìÅ</div>
          <div className="stat-content">
            <h3>Carpetas</h3>
            <p className="stat-value">{stats?.total_folders || 0}</p>
            <span className="stat-label">Total de carpetas</span>
          </div>
        </div>

        <div className="stat-card">
          <div className="stat-icon">üì∑</div>
          <div className="stat-content">
            <h3>Fotos</h3>
            <p className="stat-value">{stats?.total_photos || 0}</p>
            <span className="stat-label">Total de fotos</span>
          </div>
        </div>

        <div className="stat-card highlight">
          <div className="stat-icon">üí∞</div>
          <div className="stat-content">
            <h3>Ingresos</h3>
            <p className="stat-value">{formatCurrency(stats?.total_revenue || 0)}</p>
            <span className="stat-label">
              {stats?.revenue_change_percentage !== undefined && (
                <span className={stats.revenue_change_percentage >= 0 ? 'positive' : 'negative'}>
                  {stats.revenue_change_percentage >= 0 ? '‚Üë' : '‚Üì'} 
                  {Math.abs(stats.revenue_change_percentage).toFixed(1)}% vs semana anterior
                </span>
              )}
            </span>
          </div>
        </div>

        <div className="stat-card">
          <div className="stat-icon">üí≥</div>
          <div className="stat-content">
            <h3>Transacciones</h3>
            <p className="stat-value">{stats?.total_transactions || 0}</p>
            <span className="stat-label">
              {stats?.recent_transactions || 0} esta semana
            </span>
          </div>
        </div>
      </div>

      {/* Recent Activity */}
      <div className="dashboard-section">
        <h2>Actividad Reciente</h2>
        <div className="activity-list">
          {activities.length === 0 ? (
            <div className="empty-state">
              <p>No hay actividad reciente</p>
            </div>
          ) : (
            activities.map((activity, index) => (
              <div key={index} className="activity-item">
                <div className="activity-icon">
                  {getActivityIcon(activity.type)}
                </div>
                <div className="activity-content">
                  <p className="activity-description">{activity.description}</p>
                  <span className="activity-date">{formatDate(activity.date)}</span>
                </div>
                <div className={`activity-status ${getStatusClass(activity.status)}`}>
                  {activity.status}
                </div>
              </div>
            ))
          )}
        </div>
      </div>

      {/* Quick Actions */}
      <div className="dashboard-section">
        <h2>Acciones R√°pidas</h2>
        <div className="quick-actions">
          <a href="/admin/folders" className="quick-action-card">
            <span className="action-icon">üìÅ</span>
            <h3>Gestionar Carpetas</h3>
            <p>Crear y organizar carpetas</p>
          </a>
          <a href="/admin/photos" className="quick-action-card">
            <span className="action-icon">üì∑</span>
            <h3>Subir Fotos</h3>
            <p>A√±adir nuevas fotos</p>
          </a>
          <a href="/admin/payments" className="quick-action-card">
